CREATE TABLE QC_TASK_R (PK_TASK_R CHAR(20) NOT NULL, PK_SAMPLEGROUP VARCHAR2(20) DEFAULT '~', STDMINVALUE NUMBER(28,8), STDMAXVALUE NUMBER(28,8), PK_UNIT VARCHAR2(50), TESTFLAG CHAR(1), JUDGEFLAG CHAR(1), PK_TESTTEMPERATURE VARCHAR2(50), ANALYSISNAME VARCHAR2(50), PK_COMPONENT VARCHAR2(20) DEFAULT '~', VALUETYPE VARCHAR2(20) DEFAULT '~', PK_TASK_B CHAR(20) NOT NULL, TS CHAR(19), DR INTEGER DEFAULT 0, CONSTRAINT PK_QC_TASK_R PRIMARY KEY (PK_TASK_R));
CREATE TABLE QC_TASK_S (PK_TASK_S CHAR(20) NOT NULL, PK_TESTCONDITIONITEM VARCHAR2(20) DEFAULT '~', CONDITIONSTATUS CHAR(1), ISOPTIONAL CHAR(1), ISALLOW_OUT CHAR(1), INSTRUMENT VARCHAR2(20) DEFAULT '~', VALUETYPE VARCHAR2(20) DEFAULT '~', ENTRY VARCHAR2(50), UNIT VARCHAR2(50), FORMATTED_ENTRY VARCHAR2(50), MIN_LIMIT NUMBER(28,8), MAX_LIMIT NUMBER(28,8), ENGLISHDESCRIPTION VARCHAR2(50), PK_TASK_B CHAR(20) NOT NULL, TS CHAR(19), DR INTEGER DEFAULT 0, CONSTRAINT PK_QC_TASK_S PRIMARY KEY (PK_TASK_S));
